import React from 'react';

const divStyle = {
    color: rgb(18, 255, 18),
    backgrounColor: transparent,
    border: '0px',
    fontFamily: Courier,
    fontSize: '33pt',
};

export default function Button() {
    return <button style={divStyle} data-testid="element-button"> Wake up Neo...</button >;
}
